import React from 'react';
import Header from './Header';
import Sidebar from './Sidebar';
import Feed from './feed';
import { Widgets } from '@mui/icons-material';

function App() {
  return (
    <div className='app_wrapper'>
      {<Header/>}
      <div className='app_body'>
        {<Sidebar/>}
        {<Feed/>}
        <Widget/>
      </div>
    </div>
  );
}

export default App;
